class ElementorToggleButtonsHandler extends elementorModules.frontend.handlers.Base{getDefaultSettings(){return{selectors:{button:".elementor-toggle-buttons__button",expandButton:".elementor-toggle-buttons__button-expand",collapseButton:".elementor-toggle-buttons__button-collapse",tabTitle:".elementor-tab-title"}}}getDefaultElements(){const t=this.getSettings("selectors");return{$buttons:this.$element.find(t.button),$expandButton:this.$element.find(t.expandButton),$collapseButton:this.$element.find(t.collapseButton),$tabTitles:this.$element.find(t.tabTitle)}}bindEvents(){this.elements.$expandButton.on("click",this.onExpandButtonClick.bind(this)),this.elements.$collapseButton.on("click",this.onCollapseButtonClick.bind(this))}onExpandButtonClick(t){this.elements.$tabTitles.not(".elementor-active").trigger("click"),this.elements.$buttons.toggle(),this.elements.$collapseButton.focus()}onCollapseButtonClick(t){this.elements.$tabTitles.filter(".elementor-active").trigger("click"),this.elements.$buttons.toggle(),this.elements.$expandButton.focus()}}jQuery(window).on("elementor/frontend/init",t=>{elementorFrontend.elementsHandler.attachHandler("toggle",ElementorToggleButtonsHandler)});